import React, { useState } from 'react';
import { useQuery, useMutation, gql } from '@apollo/client';
import MemberModal from './MemberModal';
import '../assets/css/member_style.css';

const GET_MEMBERS = gql`
  query GetMembers {
    members {
      id
      imageUrl
      fullname
      role
      address
    }
  }
`;

const ADD_MEMBER = gql`
  mutation AddMember($imageUrl: String!, $fullname: String!, $role: String!, $address: String!) {
    addMember(imageUrl: $imageUrl, fullname: $fullname, role: $role, address: $address) {
      id
      imageUrl
      fullname
      role
      address
    }
  }
`;

const UPDATE_MEMBER = gql`
  mutation UpdateMember($id: ID!, $imageUrl: String, $fullname: String, $role: String, $address: String) {
    updateMember(id: $id, imageUrl: $imageUrl, fullname: $fullname, role: $role, address: $address) {
      id
      imageUrl
      fullname
      role
      address
    }
  }
`;

const DELETE_MEMBER = gql`
  mutation DeleteMember($id: ID!) {
    deleteMember(id: $id)
  }
`;

const Members = () => {
  const { loading, error, data, refetch } = useQuery(GET_MEMBERS);
  const [addMember] = useMutation(ADD_MEMBER);
  const [updateMember] = useMutation(UPDATE_MEMBER);
  const [deleteMember] = useMutation(DELETE_MEMBER);
  const [showModal, setShowModal] = useState(false);
  const [selectedMember, setSelectedMember] = useState(null);

  const handleSaveMember = async (member) => {
    if (selectedMember) {
      await updateMember({ variables: { ...member, id: selectedMember.id } });
    } else {
      await addMember({ variables: member });
    }
    refetch();
    setShowModal(false);
    setSelectedMember(null);
  };

  const handleEditMember = (member) => {
    setSelectedMember(member);
    setShowModal(true);
  };

  const handleDeleteMember = async (id) => {
    await deleteMember({ variables: { id } });
    refetch();
  };

  const handleShowModal = () => {
    setSelectedMember(null);
    setShowModal(true);
  };

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error: {error.message}</p>;

  const members = data.members;

  return (
    
    <div className="members-container">
	<div className="container">
	  <div className="row" >
        <div className="col-8">
            <div className="input-group input-group-outline">
                <label className="form-label">Search member here...</label>
                <input type="text" className="form-control mb-sm-0"/>
            </div>
        </div>
      <div className="col-auto">
        <button type="button" className="btn bg-gradient-info " data-bs-toggle="modal" data-bs-target="#exampleModal"><i className="material-icons opacity-12 me-2 text-l">add</i></button>
    </div>
	</div>
    </div>
      <div className="container">
        <div className="row">
          {members.map((member) => (
            <div className="col-lg-6 col-md-6 col-12" key={member.id}>
              <div className="card card-profile mt-4">
                <div className="row">
                  <div className="col-lg-4 col-md-6 col-12 mt-n5">
                    <a href="#">
                      <div className="p-3 pe-md-0">
                        <img className="w-100 border-radius-md shadow-lg" src={`http://localhost:4000/uploads/${member.imageUrl}`} alt={member.imageUrl} />
                      </div>
                    </a>
                  </div>
                  <div className="col-lg-8 col-md-6 col-12 my-auto">
                    <div className="card-body ps-lg-0">
                      <h5 className="mb-0">{member.fullname}</h5>
                      <h6 className="text-info">{member.role}</h6>
                      <p className="mb-0">{member.address}</p>
                      <button className="btn btn-sm bg-gradient-primary mb-0 me-1 mt-2 mt-md-0" onClick={() => handleEditMember(member)}>
                        Edit
                      </button>
                      <button className="btn btn-sm bg-gradient-primary mb-0 me-1 mt-2 mt-md-0" onClick={() => handleDeleteMember(member.id)}>
                        Delete
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
      <MemberModal
        show={showModal}
        handleClose={() => setShowModal(false)}
        saveMember={handleSaveMember}
        member={selectedMember}
      />
    </div>
  );
};

export default Members;
